import React from 'react'

import './AboutInforItemStyle.css'

export default function AboutInforItem({
    title,
    items
}) {
  return (
    <div className='items_detail'>
 
      <h2 className="title">{title}</h2>
      
      <ul>
      {items.map((item, index) =>
        <li key={index}>
          {item}
        </li>
      )}
    </ul>


      {/* {items.map((item, index) => (
      
      <ul className="item" key={index}>
        <li>{item}</li>
      </ul>
      ))} */}
      
  
        
    </div>

    
  )
}
